import { createRouter, createWebHistory } from 'vue-router'
import Home from '../views/Home.vue'

const routes = [
  {
    path: '/',
    name: 'home',
    component: Home
  },
  {
    path: '/contact',
    name: 'Contact',
    component: () => import('../views/Contact.vue'),
  },
  {
    path: '/program',
    name: 'Program',
    component: () => import('../views/Program.vue')
  },
  {
    path: '/despre-noi/echipa-manageriala',
    name: 'Echipa Managerială',
    component: () => import('../views/despre/echipa-manageriala.vue')
  },
  {
    path: '/despre-noi/baza-materiala',
    name: 'Baza Materială',
    component: () => import('../views/despre/baza-materiala.vue')
  },
  {
    path: '/news/announcements',
    name: 'Annoucements',
    component: () => import('../views/announcements/announcements.vue')
  },

  {
    path: '/open',
    name: 'Open',
    component: () => import('../components/Open.vue')
  },




  { path: "/:pathName(.*)", name: "NotFound", component: () => import("../views/Home.vue") },
  { path: '/.*', redirect: { name: 'home' } },

]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
